import react from "react";
import {
    Grid,
    Paper
}
    from "@mui/material";

import "./styles/dashboard-style.css";


//Home Page
class Dashboard extends react.Component {
    //Display the component in the screen
    render() {
        return (
            <Grid container>
                <Grid item md={3}>
                    <Paper>1</Paper>
                </Grid>
                <Grid item md={3}>
                    <Paper>2</Paper>
                </Grid>
                <Grid item md={3}>
                    <Paper>3</Paper>
                </Grid>
                <Grid item md={3}>
                    <Paper>4</Paper>
                </Grid>
            </Grid>
        );
    };
}


class NavigationMenu extends react.Component {
    render() {
        return (
            null
        );
    }
}




export default Dashboard;
